window.plugins.CouchDBAttachmentUploader = {
	upload: function(filepath, couchURI, docID, docRevision,  success, failure, options){
	    var progress = function(bytes,total){};
	    var attName = 'defaultAtt';
	    
	    // Process options
	    for(var key in options) {
			var value = options[key];
			
			if( key === 'progress' && typeof(value) === 'function' ) {
				// Callback for progress
				progress = value;
				
			} else if( 'attachmentName' === key
			   ){
				attName = value;
			};
	    };
	    
	    // Remove protocol from file path
	    var fileProt = 'file://';
	    var fileProt2 = 'file:';
	    if( filepath.substring(0,fileProt.length) === fileProt ) {
	    	filepath = filepath.substring(fileProt.length);
	    	
	    } else if( filepath.substring(0,fileProt2.length) === fileProt2 ) {
	    	filepath = filepath.substring(fileProt2.length);
	    };
	    
	    // Find data to upload
	    var uploadData = null;
	    for(var key in files){
	    	var file = files[key];
	    	if( file.path === filepath ){
	    		uploadData = file.data;
	    	};
	    };
	    if( !uploadData ){
	    	failure('Can not find file with path: '+filepath);
	    	return;
	    };
	    
	    // Call progress once to show 50%
	    progress(200,1000);
	    
	    // Upload content
	    var couchDb = $n2.couch.DefaultServer.getDb({
	    	dbUrl: couchURI
	    });
	    
	    couchDb.getDocument({
			docId: docID
			,onSuccess: documentFetched
			,onError: function(errorMsg){
				failure("Unable to fetch document: "+errorMsg);
			}
	    });

	    function documentFetched(doc){
	    	if( !doc._attachments ) doc._attachments = {};
	    	if( !doc._attachments[attName] ) doc._attachments[attName] = {};
	    	doc._attachments[attName].contentType = options['contentType'];
	    	doc._attachments[attName].data = uploadData;

	    	progress(500,1000);
	    	
	    	couchDb.updateDocument({
				data: doc
				,onSuccess: documentUpdated
				,onError: function(errorMsg){
					failure("Unable to update document: "+errorMsg);
				}
	    	});
	    };

	    function documentUpdated(docInfo){
	    	success(docInfo);
	    };
	}
};

// *** File system ***
var _FileEntry = function(path) {
	this.path = path;
	var pathFragments = path.split('/');
	this.name = pathFragments[pathFragments.length - 1];
};
_FileEntry.prototype.remove = function(success,failure){
	success();
};

window.resolveLocalFileSystemURI = function(path, success, failure){
	var fileEntry = new _FileEntry(path);
	success(fileEntry);
};


// *** File Reader ***
window.FileReader = function(){};
window.FileReader.prototype.readAsDataURL = function(mediaFile){
	$n2.log('FileReader',this,mediaFile);
	var evt = {
		target:{
			result: mediaFile._content
		}
	};
	var _this = this;
	window.setTimeout(function(){
		_this.onloadend(evt);
	},10);
};


// Fake Cordova plugin for Nunaliit
window.plugins.CDVPluginNunaliit = {
	restartCouchDb: function(options){
	    var onSuccess = function(){}
	    ,onError = onSuccess;
	    
	    // Process options
	    for(var key in options) {
			var value = options[key];
			
			if( key === 'onSuccess' && typeof(value) === 'function' ) {
				onSuccess = value;

			} else if( key === 'onError' && typeof(value) === 'function' ) {
				onError = value;
			};
	    };
	    
	    // Wait for a while to simulate restarting CouchDB
	    window.setTimeout(function(){
	    	//window.couchLocation=?;
	    	if( window.couchBoot ) window.couchBoot();
	    },1500);
	    
	    // Callback
	    onSuccess();
	}
	
	,couchBaseInfo: function(options){
	    var onSuccess = function(){}
	    ,onError = onSuccess;
	    
	    // Process options
	    for(var key in options) {
			var value = options[key];
			
			if( key === 'onSuccess' && typeof(value) === 'function' ) {
				onSuccess = value;
	
			} else if( key === 'onError' && typeof(value) === 'function' ) {
				onError = value;
			};
	    };
	    
	    // Callback
	    onSuccess({
	    	location: window.couchLocation
	    	,errorMsg: null
	    });
	}
};
